Para mí volver a la tierra es re-cordar el poder de la vida. Maestra de los ciclos naturales, el ciclo vida muerte vida susurra su lección eterna. 

De volver a la tierra amo, que cada vez que vuelvo a ella, mi mirada se renueva, mi conciencia se expande, y aunque este ritual imprescindible se repita una y otra vez en el devenir del tiempo, siempre mi ser se llena de asombro, mi alma late viendo un milagro. 

Es el milagro de la vida que se hace materia y es para mí profunda la convicción de que la vida está diseñada para prosperar, que no hoy modo de detener lo que está destinado a germinar en abundancia. Entonces en ella, la Madre Tierra mi ser conecta tan hondamente con la fertilidad y la abundancia y la muerte como camino a todo el potencial al que estamos destinad@s. Una sola planta, una sola vaina (de cientos de una sola planta), una semilla de esa sola vaina y la posibilidad de albergar otras cientos de semillas... Solo me regocijo en esta verdad que aflora en la palma de mi mano y me llena de esperanzas y me invita a que podamos multiplicar estos dones, compartirlos, recordarnos siendo hijos a hijas de una tierra generosa, que si sabemos cuidar y relacionarnos con ella, nos enseña a vivir material y espiritualmente esta vida humana... 🙏

🌱🌱🌱 ¡¡¡Qué viva la vida!!!!🌱🌱🌱

