Ao longo dos meus anos de graduação, tive a oportunidade de conhecer diversas formas de se perceber a realidade. Na disciplina de História Medieval, escrevi junto com a minha grande amiga @quimis_ um trabalho que falava sobre o medo, com foco na morte. A vida no medievo era difícil, não se alongava por muito tempo e o medo em relação à morte era voltado ao que que viria no seu pós, a salvação divina ou a danação interna.
Sentimentos muito bem apresentados por Dante Alighieri na obra "A divina Comédia" e o historiador Jean Delumeau. 
Diferente daquele tempo, na nossa existência o medo se refere não tanto ao pós vida, em virtude das diversas visões sobre o que acontece quando morremos, cada um encontra conforto onde mais lhe agrada. Mas então, do que tanto se tem medo no que se refere à morte?

Encontramos respostas pra isso com o querido Zygmunt Bauman, que no livro "Medo Liquido" apresenta um medo voltado a existência, desaparecer, deixar de existir.
E por isso que eu, como típica pessoa do meu tempo, me questionei sobre as marcas que deixei pelo mundo.

Vocês já se perguntaram sobre o legado que deixam? Se fizeram algo que de alguma forma deixou o mundo melhor? 

Sempre é tempo de começar, fazer o bem e praticar a caridade, apenas pelo ato de fazê-lo.

Estou trabalhando em mim essa exposição dos meus pensamentos e reflexões. Quem quiser bater um papo sobre esses ou mais assuntos históricos/filosóficos/espirituais, estamos aí!

